    }

    private async Task SubmitSinhVien(EditContext context)
    {
        var result = await SinhVienApiClient.UpdateSV(Guid.Parse(SinhVienID), SinhVien);
        if (result)
        {
            NavigationManager.NavigateTo("/sinhvien");
        }
    }

